import React from 'react';
import './News.scss';

class News extends React.Component {

    render() {
        if (!this.props.weather) {
            return null;
        } else {
            return (
                <div className='news'>
                    <div className='news__row'>
                        <div className='news__box'>{this.props.weather.weather.main}</div>
                    </div>
                </div>
            )
        }
    }
}

export default News;
